import React from 'react';
import {
  Container,
  Slider,
  Typography
} from '@material-ui/core';

export default function App(){
  const marks = [
    {
      value: 1,
      label: 1
    },
    {
      value: 2,
      label: 2
    },
    {
      value: 3,
      label: 3
    },
    {
      value: 4,
      label: 4
    },
    {
      value: 5,
      label: 5
    },
    {
      value: 6,
      label: 6
    },
    {
      value: 7,
      label: 7
    },
    {
      value: 8,
      label: 8
    },
    {
      value: 9,
      label: 9
    },
    {
      value: 10,
      label: 10
    }
  ];

  return(
    <Container>
      <Typography>On a scale of 0 to 10, how likely are you to recommend me as a person to work with?</Typography>
      <Slider
        defaultValue={10}
        marks={marks}
        max={10}
        min={1}
        steps={10}
        valueLabelDisplay="on"/>
    </Container>
  )
};
